import React, { useRef } from "react";
import { motion, useScroll, useTransform, useSpring } from "framer-motion";
import Header from "./Header";
import InteractiveLines from "./InteractiveLines";

const Pawmeet: React.FC = () => {
  const { scrollY } = useScroll();
  const x = useTransform(scrollY, [0, 400], [0, -200]);
  const xSpring = useSpring(x, { stiffness: 100, damping: 30 });

  return (
    <div className="relative min-h-screen bg-[#F4F1EC]">
      <Header />
      <section className="relative w-full min-h-[100vh] h-screen overflow-hidden">
        <InteractiveLines />
        <div className="absolute inset-0 flex items-center justify-center">
          <motion.div
            className="relative z-20 translate-y-50"
            animate={{
              y: [0, -20, 0],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <img src="/card1.png" alt="Card" className="w-80 h-auto" />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-right mt-[45vh] md:mt-[25vh] pr-[5vw] whitespace-nowrap"
          style={{ x: xSpring }}
        >
          PAWMEET
        </motion.h1>
      </section>
      
      <section className="relative w-full min-h-screen bg-gradient-to-b from-[#E8F5E9] to-white py-20 px-8 flex items-center justify-center">
        <div className="max-w-sm w-full mx-auto bg-white rounded-3xl shadow-lg p-8 relative">
          {/* Paw Logo */}
          <div className="flex justify-center mb-6">
            <img src="/paw-logo.svg" alt="Paw Meet Logo" className="w-24 h-24" />
          </div>
          
          {/* App Name */}
          <h2 className="text-2xl font-bold text-center mb-8">PAW MEET</h2>
          
          
          
         
         
        </div>
      </section>
    </div>
  );
};

export default Pawmeet;
